schemaVersions.content:
{
  "openapi": "3.0.0",
  "info": {
    "title": "Your API Name",
    "version": "1.0.0",
    "description": "Description of your API"
  },
  "servers": [
    {
      "url": "https://api.example.com/v1"
    }
  ],
  "paths": {
    "/submitOrder": {
      "post": {
        "summary": "Submit Order",
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "definitionId": {
                    "type": "string"
                  },
                  "context": {
                    "type": "object",
                    "properties": {
                      "orderHeader": {
                        "type": "array",
                        "items": {
                          "type": "object",
                          "properties": {
                            "salesOrderNumber": {
                              "type": "string"
                            },
                            "creator": {
                              "type": "string"
                            },
                            "date": {
                              "type": "integer"
                            },
                            "salesType": {
                              "type": "string"
                            },
                            "ordertype": {
                              "type": "string"
                            },
                            "salesOrg": {
                              "type": "string"
                            },
                            "distributionChannel": {
                              "type": "string"
                            },
                            "division": {
                              "type": "string"
                            },
                            "customer": {
                              "type": "array",
                              "items": {
                                "type": "object",
                                "properties": {
                                  "customerId": {
                                    "type": "string"
                                  },
                                  "customerName": {
                                    "type": "string"
                                  },
                                  "zipCode": {
                                    "type": "string"
                                  },
                                  "street": {
                                    "type": "string"
                                  },
                                  "phone": {
                                    "type": "string"
                                  },
                                  "country": {
                                    "type": "string"
                                  },
                                  "city": {
                                    "type": "string"
                                  }
                                }
                              }
                            },
                            "orderItem": {
                              "type": "array",
                              "items": {
                                "type": "object",
                                "properties": {
                                  "item": {
                                    "type": "string"
                                  },
                                  "material": {
                                    "type": "string"
                                  },
                                  "materialType": {
                                    "type": "string"
                                  },
                                  "itemType": {
                                    "type": "string"
                                  },
                                  "orderSchedule": {
                                    "type": "array",
                                    "items": {
                                      "type": "object",
                                      "properties": {
                                        "scheduleNumber": {
                                          "type": "string"
                                        },
                                        "quantity": {
                                          "type": "integer"
                                        },
                                        "uom": {
                                          "type": "string"
                                        }
                                      }
                                    }
                                  }
                                }
                              }
                            }
                          }
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Order submitted successfully"
          },
          "400": {
            "description": "Bad Request"
          }
        }
      }
    }
  },
  "components": {
    "securitySchemes": {
      "apiKey": {
        "type": "apiKey",
        "in": "header",
        "name": "X-API-Key"
      }
    }
  }
}
